import Menu from "../menu";

const GroupSetting = ({ data, setData }) => {

    let grouplist = data.map((item)=>   item.group    );


    return (
        <div className="app">
            <Menu/>
            <div className="groupsetting">
                <h1>Group Setting</h1>
                <h3 id="groupsetting">顏色設定</h3>
                <div>
                    <input list="grouplist" id="changegroup" />
                    <datalist id="grouplist">
                    {grouplist.map((d)=> {
                        return (
                            <option value={d} />
                        )
                    })}
                    </datalist>
                </div>
            </div>
        </div>
    )
};

export default GroupSetting;
